import React from 'react';

const Footer = () => {
  const brand = {
    primary: '#7a1720',
  };

  return (
    <footer style={{ backgroundColor: brand.primary, color: '#fff', padding: '1.25rem 0', marginTop: 32 }}>
      <div style={{ maxWidth: 1200, margin: '0 auto', display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
        <div style={{ fontSize: 13 }}>© {new Date().getFullYear()} Marwa Safaris Africa — All rights reserved</div>
        <div style={{ display: 'flex', gap: 12 }}>
          <a href="#privacy" style={{ color: '#fff', textDecoration: 'none' }}>Privacy</a>
          <a href="#terms" style={{ color: '#fff', textDecoration: 'none' }}>Terms</a>
          <a href="#careers" style={{ color: '#fff', textDecoration: 'none' }}>Careers</a>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
